    return (
        <div className='wrapper'>
            <Container>
              <ReactPlayer url='https://www.youtube.com/watch?v=ysz5S6PUM-U' />
            </Container>
            <div ref={ref}>
      <h2>{`Header inside viewport ${inView}.`}</h2>
    </div>
        </div>
    )
}

export default HomeContainer
